import { useHistory } from "react-router-dom/cjs/react-router-dom.min";
import { useEffect, useState } from "react";
import axios from "../../DataAccess/AxiosTemp";


function AddressDtl() {

    const history = useHistory();

    const CandidateSignUp3 = () => {
        history.push("/CandidateSignUp3");
    }







    const [userAddress, setuserAddress] = useState({
        email: "",
        state: "",
        country: "",
        region: "",
        district: "",
        city: "",
        pincode: 0
    });

    const [options, setOptions] = useState([]);
    const [selectedOption, setSelectedOption] = useState("region");


    useEffect(()=>{

        userAddress.region = selectedOption.region;
    },[selectedOption])

    useEffect(() => {

        axios.get('/authorize/getRegion', {
            headers: {
                Accept: 'application/json',
            },
        })
            .then(response => {
                setOptions(response.data);

            })
            .catch(error => {
                console.error('Error fetching options:', error);
            });
    }, []);

    const handleSelectChange = event => {
        setSelectedOption(event.target.value);
    };


    const userAddresschange = (args) => {
        var copyofaddress = { ...userAddress };

        copyofaddress[args.target.name] = args.target.value;
        setuserAddress(copyofaddress);
    }
    userAddress.email = localStorage.getItem("emailforVoterAddressAddUses");

    const processs = ()=>{

         userAddress.region= selectedOption;
         debugger;
        addAddress();
        history.push("/Login")

    }
    const addAddress = async () => {
        try {
            console.log(userAddress)
            const result = await axios.post('/authorize/addAddress', userAddress, {
                headers: {
                    'Content-Type': 'application/json',
                },
            })


        }
        catch (error) {
            console.log("Error Occured" + error);
        }
    }
    return <>

        <div>
            <div className="jumbotron" style={{ backgroundColor: 'rgb(250, 248, 228)' }} >
                <center><h1>Candidate Sign Up</h1></center>
                <center><h2>Enter Details</h2></center>
                <center><h2>2/3</h2></center>
            </div>
        </div>




        <div className="container-fluid text-center">

            <div className="row content">
                <div className="col-lg-5 sidenav">

                    <div>
                        <div><center><big>Conutry</big></center></div>
                        <input type="text" placeholder="Enter First Name" className="form-control"></input>
                    </div>

                    <br></br>
                    <div>
                        <div><center><big>State</big></center></div>
                        <input type="text" placeholder="Enter Last Name" className="form-control"></input>
                    </div>

                    <br></br>
                    <div>
                        <div><center><big>District</big></center></div>
                        <input type="text" placeholder="District" className="form-control"></input>
                    </div>

                    <br></br>
                    <div>
                        <div><center><big>City</big></center></div>
                        <input type="number" placeholder="Enter A Valid Id number" className="form-control"></input>
                    </div>


                </div>
                <div className="col-lg-2 text-center">

                </div>
                <div className="col-lg-5 sidenav">



                    <div>
                        <div><center><big>Pincode</big></center></div>
                        <input type="number" placeholder="Enter the Password" className="form-control"></input>
                    </div>

                    <br></br>
                    <br></br><b>Select The Region (Where Your VoterId Issued)</b><br></br><br></br>
                    <div>
                        <select value={userAddress.region} onChange={handleSelectChange} className="custom-select">
                            <option value="">Select an option</option>
                            {options.map(option => (
                                <option key={option.regionId} value={option.regionName}>
                                    {option.regionName}
                                </option>
                            ))}
                        </select>
                        <br></br>
                        <h4><p>Selected option: {selectedOption}</p></h4>
                    </div>



                </div>
            </div>
            <br></br><br></br>
            <div><button type="button" class="btn btn-success" onClick={CandidateSignUp3}>Next</button></div>
        </div>


    </>
}

export default AddressDtl;
